$=jQuery;$(document).ready(function(){var buyMoreWindow=$("#smsifywindow");var getKeyWindow=$("#smsifywindow2");buyMoreWindow.kendoWindow({width:"450px",height:"500px",modal:true,visible:false,title:"SMSify - Purchase SMS Credits",actions:["Refresh","Maximize","Close"],content:"https://www.smsify.com.au/pricing/"});getKeyWindow.kendoWindow({width:"450px",height:"500px",modal:true,visible:false,title:"SMSify - Register Account",actions:["Refresh","Maximize","Close"],content:"https://www.smsify.com.au/pricing/"});buyMoreWindow.keypress(function(event){if(event.keyCode===27){window.data("kendoWindow").close()}});getKeyWindow.keypress(function(event){if(event.keyCode===27){window.data("kendoWindow").close()}});$("#buymore").click(function(e){buyMoreWindow.data("kendoWindow").center();buyMoreWindow.data("kendoWindow").open()});$("#smsify-get-key").click(function(e){getKeyWindow.data("kendoWindow").center();getKeyWindow.data("kendoWindow").open()});function keyROMode(){if(existing_app_user){$(".api-key-edit").hide()}else{$(".api-key-edit").show();$(".smsify-cancel-key").hide()}$(".api-key-saving").hide();$(".sms-inbound-saving").hide();$(".api-key-ro").show()}function keyEditMode(){$(".api-key-ro").hide();$(".api-key-saving").hide();$(".api-key-edit").show()}function keySavingMode(){$(".api-key-ro").hide();$(".api-key-edit").hide();$(".api-key-saving").show()}keyROMode();$(".smsify-edit-key").click(function(e){keyEditMode()});$(".smsify-cancel-key").click(function(e){keyROMode()});$(".smsify-save-key").click(function(e){if($("#apiKey").val().length!="32"){alert("Invalid API Key. Please make sure you enter a valid 32 character API key.")}else{keySavingMode();$("#key-form").submit()}})});